ue</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>271</id>\n  <compositionString>SQL-ARV-Regimen-2-or-3-months-drug-prescription-in-prev.-1-month OR SQL-ARV-Regimen-3-months-drug-prescription-in-prev.-2-months</compositionString>\n  <searches id=\"9\">\n    <entry>\n      <string>SQL-ARV-Regimen-2-or-3-months-drug-prescription-in-prev.-1-month</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"11\" uuid=\"d987055f-14bb-4a9e-be79-050bba503637\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>SQL-ARV-Regimen-3-months-drug-prescription-in-prev.-2-months</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"13\">\n        <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"14\" uuid=\"98a1122a-d39d-4a67-bed0-7489dd29608d\"/>\n        <parameterMappings reference=\"12\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </searches>\n</org.openmrs.module.reporting.cohort.definition.CompositionCohortDefinition>','2018-10-29 16:18:41',4,'2018-10-29 16:22:28',4,0,NULL,NULL,NULL,'f2af4f7d-643e-4ee6-93eb-74488cf98704'),(272,'Clients seen 1f','1f','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"55df743e-4818-40e3-9df4-f76db645b660\" retired=\"false\">\n  <name>Clients seen 1f</name>\n  <description>1f</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2018-10-30 08:31:02 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 08:58:37 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>272</id>\n  <query>select distinct patient.patient_id&#xd;\nfrom obs o&#xd;\n-- CLIENTS SEEN FOR ART&#xd;\n	inner join location l on o.location_id = l.location_id&#xd;\n	INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n	AND (o.concept_id = 3843 AND o.value_coded = 3841 OR o.value_coded = 3842)&#xd;\n	AND MONTH(o.obs_datetime) = MONTH(CAST(:endDate AS DATE))&#xd;\n        AND YEAR(o.obs_datetime) =  YEAR(CAST(:endDate AS DATE))&#xd;\n	AND patient.voided = 0 AND o.voided = 0&#xd;\n	INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n        &#xd;\nWHERE (o.location_id =:location or parent_location =:location)&#xd;\nand o.person_id in(&#xd;\n		select distinct person_id&#xd;\n		from obs&#xd;\n        -- All patients given 1F regimen during a particular period&#xd;\n		where concept_id = 2250 and value_coded = 2207&#xd;\n		AND obs_datetime between :startDate AND :endDate&#xd;\n)&#xd;\nand patient.patient_id not in  -- CLIENTS NEWLY INITIATED ON ART&#xd;\n	                       (select distinct patient.patient_id AS Id&#xd;\n	                       from obs o&#xd;\n							INNER JOIN patient ON o.person_id = patient.patient_id													&#xd;\n							AND (o.concept_id = 2249 AND DATE(o.value_datetime) BETWEEN :startDate AND :endDate)&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n							and patient.patient_id not in(&#xd;\n														select distinct os.person_id from obs os															 &#xd;\n														where os.concept_id = 2396 														 &#xd;\n														AND DATE(os.obs_datetime) BETWEEN :startDate AND :endDate)&#xd;\n							&#xd;\n							)&#xd;\nAND o.person_id not in (																 &#xd;\n						select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n					group by person_id) one,&#xd;\n					&#xd;\n					(select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843 &#xd;\n                    and obs_datetime &lt;= :endDate) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)													 &#xd;\n                        )&#xd;\n&#xd;\nAND patient.patient_id not in &#xd;\n			(&#xd;\n			select distinct person_id &#xd;\n			from person&#xd;\n			where death_date &lt;=	 :endDate&#xd;\n			and dead = 1&#xd;\n			)						&#xd;\n				&#xd;\n														</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2018-10-30 08:31:02',4,'2019-05-09 08:58:37',4,0,NULL,NULL,NULL,'55df743e-4818-40e3-9df4-f76db645b660'),(273,'Clients multi month 1f','1f','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"a018ec2e-bf15-49cb-96e2-cbfe9201211e\" retired=\"false\">\n  <name>Clients multi month 1f</name>\n  <description>1f</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2018-10-30 08:55:29 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 09:02:12 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.