ng>${startDate}</string>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2019-01-29 22:00:24',4,'2019-01-29 22:01:08',4,0,NULL,NULL,NULL,'dc060565-40ef-4a71-b515-28cd018fb5d6'),(339,'Discordant couples SQL','Discordant couples','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"b3b772a7-7fc2-40d4-bbaa-8fe6e5eb9bd9\" retired=\"false\">\n  <name>Discordant couples SQL</name>\n  <description>Discordant couples</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-01-31 04:56:06 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-01-31 05:06:40 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>339</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o inner join location l on o.location_id = l.location_id&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\nand o.concept_id = 4225 and o.value_coded = 2146</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-01-31 04:56:06',4,'2019-01-31 05:06:40',4,0,NULL,NULL,NULL,'b3b772a7-7fc2-40d4-bbaa-8fe6e5eb9bd9'),(340,'ART Start date SQL','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"6f37715f-711c-48fa-8f56-e3360233d885\" retired=\"false\">\n  <name>ART Start date SQL</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-01-31 08:49:55 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 08:30:16 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>340</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o &#xd;\n	inner join location l on o.location_id = l.location_id&#xd;\n	INNER JOIN person ON person.person_id = o.person_id&#xd;\n	&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\n	AND o.concept_id = 2249 &#xd;\n	AND o.value_datetime BETWEEN :startDate AND :endDate&#xd;\n	AND MONTH(o.value_datetime) = MONTH(CAST(:endDate AS DATE))&#xd;\n    AND YEAR(o.value_datetime) =  YEAR(CAST(:endDate AS DATE))&#xd;\n	AND o.voided = 0&#xd;\n	&#xd;\nAND o.person_id not in (&#xd;\n   select distinct os.person_id &#xd;\n   from obs os&#xd;\n   where os.concept_id = 3634 AND os.value_coded = 2095 &#xd;\n   AND MONTH(obs_datetime) = MONTH(CAST(:endDate AS DATE))&#xd;\n   AND YEAR(obs_datetime) =  YEAR(CAST(:endDate AS DATE))&#xd;\n   )&#xd;\nAND o.person_id not in &#xd;\n	(&#xd;\n	select distinct person_id &#xd;\n						from person&#xd;\n						where death_date &lt;= :endDate&#xd;\n						and dead = 1&#xd;\n	)&#xd;\nAND o.person_id not in &#xd;\n	(&#xd;\n		select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt;= :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n					and obs_datetime &lt;= :endDate&#xd;\n                    group by person_id) one,&#xd;\n					&#xd;\n					 (&#xd;\n					select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843&#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n					) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)	&#xd;\n	)&#xd;\nAND person.voided = 0						 &#xd;\n;&#xd;\n</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-01-31 08:49:55',4,'2019-05-09 08:30:16',4,0,NULL,NULL,NULL,'6f37715f-711c-48fa-8f56-e3360233d885'),(341,'ART restart date SQL','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"f1a22112-f4e3-47eb-a3c8-beff0cc47bd4\" retired=\"false\">\n  <name>ART restart date SQL</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-01-31 09:40:55 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-05 12:49:44 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>341</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o inner join location l on o.location_id = l.location_id&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\nand o.concept_id = 3708 and value_datetime between :startDate and :endDate&#xd;\nand obs_datetime &gt;=:startDate &#xd;\nand obs_datetime &lt;=:endDate</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-01-31 11:40:55',4,'2020-06-05 14:49:44',4,0,NULL,NULL,NULL,'f1a22112-f4e3-47eb-a3c8-beff0cc47bd4'),(342,'ART clients seen SQL','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"092398d1-86b9-4486-97ff-2864ef7871e9\" retired=\"false\">\n  <name>ART clients seen SQL</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-01-31 10:45:08 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 08:22:24 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>342</id>\n  <query>select distinct patient.patient_id&#xd;\nfrom obs o&#xd;\n-- CLIENTS SEEN FOR ART&#xd;\n	inner join location l on o.location_id = l.location_id&#xd;\n	INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n	AND (o.concept_id = 3843 AND o.value_coded = 3841 OR o.value_coded = 3842)&#xd;\n	AND MONTH(obs_datetime) = MONTH(CAST(:endDate AS DATE))&#xd;\n    AND YEAR(obs_datetime) =  YEAR(CAST(:endDate AS DATE))&#xd;\n	AND patient.voided = 0 AND o.voided = 0&#xd;\n	INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n        &#xd;\nWHERE (o.location_id =:location or parent_location =:location)&#xd;\nand patient.patient_id not in  -- EXCLUDE CLIENTS NEWLY INITIATED ON ART&#xd;\n	                       (select distinct patient.patient_id AS Id&#xd;\n	                       from obs o&#xd;\n							INNER JOIN patient ON o.person_id = patient.patient_id													&#xd;\n							AND (o.concept_id = 2249 AND DATE(o.value_datetime) BETWEEN :startDate AND :endDate)&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n							and patient.patient_id not in(&#xd;\n														select distinct os.person_id from obs os															 &#xd;\n														where os.concept_id = 2396 														 &#xd;\n														AND DATE(os.obs_datetime) BETWEEN :startDate AND :endDate)&#xd;\n							&#xd;\n							)&#xd;\nAND o.person_id not in (&#xd;\n						-- EXCLUDE TRANSFER OUT WHO CAME BACK												&#xd;\n						select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n					group by person_id) one,&#xd;\n					&#xd;\n					(select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843 &#xd;\n                    and obs_datetime &lt;= :endDate) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)													 &#xd;\n                        )&#xd;\n&#xd;\nAND patient.patient_id not in &#xd;\n			-- EXCLUDE DEAD&#xd;\n			(&#xd;\n			select distinct person_id &#xd;\n			from person&#xd;\n			where death_date &lt; :endDate&#xd;\n			and dead = 1&#xd;\n			)						&#xd;\n				&#xd;\n														</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-01-31 10:45:08',4,'2019-05-09 08:22:24',4,0,NULL,NULL,NULL,'092398d1-86b9-4486-97ff-2864ef7871e9'),(343,'ART Clients transferred in SQL','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"08280ca8-e857-4730-8350-950ab55aee95\" retired=\"false\">\n  <name>ART Clients transferred in SQL</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-01-31 10:53:28 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-01-31 11:06:18 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>343</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o inner join location l on o.location_id = l.location_id&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\nand o.concept_id = 2396 &#xd;\nand obs_datetime &gt;=:startDate &#xd;\nand obs_datetime &lt;=:endDate</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>