ncept_id = 2249&#xd;\nand obs_datetime &gt;=:startDate &#xd;\nand obs_datetime &lt;=:endDate&#xd;\n)&#xd;\nand o.obs_datetime &gt;=:startDate &#xd;\nand o.obs_datetime &lt;=:endDate;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-03 19:59:50',4,'2019-02-03 20:09:02',4,0,NULL,NULL,NULL,'a10eb64a-10db-4cc9-a69a-e9659e634918'),(360,'pre art test new diagnosed','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"44860f5e-0ce8-466d-8c01-c2ff60737256\" retired=\"false\">\n  <name>pre art test new diagnosed</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-04 07:51:40 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-02-04 07:56:11 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>360</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o inner join location l on o.location_id = l.location_id&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\nand o.concept_id = 2222&#xd;\nand o.person_id in&#xd;\n(&#xd;\nselect person_id&#xd;\nfrom obs&#xd;\nwhere concept_id = 2223&#xd;\nand obs_datetime &gt;=:startDate &#xd;\nand obs_datetime &lt;=:endDate&#xd;\n)&#xd;\nand o.person_id not in&#xd;\n(&#xd;\nselect person_id&#xd;\nfrom obs&#xd;\nwhere concept_id = 2249&#xd;\nand obs_datetime &gt;=:startDate &#xd;\nand obs_datetime &lt;=:endDate&#xd;\n)&#xd;\nand o.obs_datetime &gt;=:startDate &#xd;\nand o.obs_datetime &lt;=:endDate;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-04 07:51:40',4,'2019-02-04 07:56:11',4,0,NULL,NULL,NULL,'44860f5e-0ce8-466d-8c01-c2ff60737256'),(361,'pre art test newly enrolled','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"1796e0e3-bf74-436b-8b98-4258885a7d1f\" retired=\"false\">\n  <name>pre art test newly enrolled</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-04 08:07:56 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-02-04 08:14:46 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>361</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o inner join location l on o.location_id = l.location_id&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\nand o.concept_id = 2223&#xd;\nand o.person_id not in&#xd;\n(&#xd;\nselect person_id&#xd;\nfrom obs&#xd;\nwhere concept_id = 2249&#xd;\n)&#xd;\nand o.obs_datetime &gt;=:startDate &#xd;\nand o.obs_datetime &lt;=:endDate;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-04 08:07:56',4,'2019-02-04 08:14:46',4,0,NULL,NULL,NULL,'1796e0e3-bf74-436b-8b98-4258885a7d1f'),(362,'Clients seen in previous 1 through 6 months SQL','All clients seen in previous 1 through 6 months given multi month supply','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"6f3593ef-a36c-4d2c-a10b-801b5bc8596b\" retired=\"false\">\n  <name>Clients seen in previous 1 through 6 months SQL</name>\n  <description>All clients seen in previous 1 through 6 months given multi month supply</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-04 13:45:38 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 08:18:36 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>362</id>\n  <query>SELECT DISTINCT Id&#xd;\nFROM&#xd;\n(&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n        from obs o&#xd;\n				-- CAME IN PREVIOUS 1 MONTH AND WAS GIVEN (2, 3, 4, 5, 6 MONHTS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n				  AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -1 MONTH)) &#xd;\n				  and YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -1 MONTH)) AND patient.voided = 0 AND o.voided = 0 &#xd;\n				  AND (o.concept_id = 4174 and o.value_coded in (4176,4177,4245,4246,4247))&#xd;\n                 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n				WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n			)&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n				-- CAME IN PREVIOUS 2 MONTHS AND WAS GIVEN (3, 4, 5, 6 MONHTS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id &#xd;\n				 INNER JOIN location l on o.location_id = l.location_id&#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -2 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -2 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4177,4245,4246,4247))&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id &#xd;\n					 AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n	   &#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n				-- CAME IN PREVIOUS 3 MONTHS AND WAS GIVEN (4, 5, 6 MONTHS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id &#xd;\n				 INNER JOIN location l on o.location_id = l.location_id					 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -3 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -3 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4245, 4246 ,4247))&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0		&#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n				-- CAME IN PREVIOUS 4 MONTHS AND WAS GIVEN (5, 6 MONHTS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id &#xd;\n				 INNER JOIN location l on o.location_id = l.location_id					 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -4 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -4 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4246,4247))&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n&#xd;\n&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n				-- CAME IN PREVIOUS 5 MONTHS AND WAS GIVEN (6 MONHTS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND o.concept_id = 4174 and o.value_coded = 4247&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n		&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -1 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -1 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4175))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -1 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -1 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location  or parent_location =:location )								&#xd;\n					 )&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location )&#xd;\n				)&#xd;\n		   &#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -2 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -2 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4176))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN patient ON os.person_id = patient.patient_id&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -2 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -2 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location  or parent_location =:location )								&#xd;\n					 )&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n		   &#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id	&#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -3 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -3 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4177))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN patient ON os.person_id = patient.patient_id&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -3 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -3 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location  or parent_location =:location )&#xd;\n					 )&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id	&#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -4 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -4 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4245))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN location l on os.location_id = l.location_id	&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -4 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -4 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location  or parent_location =:location )								&#xd;\n					 )&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location ) &#xd;\n				)&#xd;\n&#xd;\n&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4246))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN location l on os.location_id = l.location_id	&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -5 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n							AND (os.location_id =:location  or parent_location =:location )							&#xd;\n					 )&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					WHERE (o.location_id =:location  or parent_location =:location )&#xd;\n					&#xd;\n				)&#xd;\n&#xd;\n&#xd;\n&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id&#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND (o.concept_id = 4174 and o.value_coded in (4247))&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN patient ON os.person_id = patient.patient_id&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -6 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location  or parent_location =:location ))&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n		WHERE (o.location_id =:location  or parent_location =:location )&#xd;\n					 )&#xd;\n) AS ARTCurrent_PrevMonths&#xd;\n &#xd;\nWHERE ARTCurrent_PrevMonths.Id not in (&#xd;\n				select distinct patient.patient_id&#xd;\nfrom obs o&#xd;\n--  EXCLUDE CLIENTS SEEN IN THE MONTH&#xd;\n	INNER JOIN location l on o.location_id = l.location_id&#xd;\n	INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n	AND (o.concept_id = 3843 AND o.value_coded = 3841 OR o.value_coded = 3842)&#xd;\n	AND MONTH(obs_datetime) = MONTH(CAST(:endDate AS DATE))&#xd;\n    AND YEAR(obs_datetime) =  YEAR(CAST(:endDate AS DATE))&#xd;\n	AND patient.voided = 0 AND o.voided = 0&#xd;\n	INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n	WHERE (o.location_id =:location  or parent_location =:location ))&#xd;\nand Id not in (&#xd;\n	                       select distinct patient.patient_id AS Id&#xd;\n	                       from obs o&#xd;\n	                       -- CLIENTS NEWLY INITIATED ON ART&#xd;\n							INNER JOIN patient ON o.person_id = patient.patient_id													&#xd;\n							AND (o.concept_id = 2249 AND DATE(o.value_datetime) BETWEEN :startDate AND :endDate)&#xd;\n							AND patient.voided = 0 AND o.voided = 0)&#xd;\nAND Id not in (																		 &#xd;\n                -- EXCLUDE CLIENTS WHO TRANSFERRED OUT AND LATER CAME BACK&#xd;\n				select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n					and obs_datetime &lt;= :endDate&#xd;\n                    group by person_id) one,&#xd;\n					&#xd;\n					 (&#xd;\n					select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843 &#xd;\n					and obs_datetime &lt;= :endDate) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)															  														 							 &#xd;\n              )&#xd;\nAND Id not in (&#xd;\n			-- EXCLUDE DEAD CLIENTS&#xd;\n			select person_id &#xd;\n			from person &#xd;\n			where death_date &lt; DATE_ADD(:endDate,interval 1 DAY) &#xd;\n			and dead = 1&#xd;\n			)&#xd;\nAND Id not in(&#xd;\n				-- EXCLUDE MISSED APPOINTMENTS&#xd;\n				select distinct Id from&#xd;\n				(select distinct person_id as Id, max(value_datetime), datediff(CAST(:endDate AS DATE), max(value_datetime)) AS Num_Days&#xd;\n				FROM obs&#xd;\n				WHERE concept_id = 3752&#xd;\n				group by person_id&#xd;\n				HAVING Num_Days &gt;= 7) as finalised&#xd;\n			)</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-04 13:45:38',4,'2019-05-09 08:18:36',4,0,NULL,NULL,NULL,'6f3593ef-a36c-4d2c-a10b-801b5bc8596b'),(363,'Clients with baseline CD4 counts 12mnths','Clients with baseline CD4 counts 12mnths','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"fa2725bc-529d-43a8-8153-815da5e1cfca\" retired=\"false\">\n 