e) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)															  														 							 &#xd;\n              )&#xd;\nAND Id not in (&#xd;\n			select person_id &#xd;\n			from person &#xd;\n			where death_date &lt; DATE_ADD(:endDate,interval 1 DAY) &#xd;\n			and dead = 1&#xd;\n			)&#xd;\nAND Id not in(&#xd;\n				select distinct Id from&#xd;\n				(select distinct person_id as Id, max(value_datetime), datediff(CAST(:endDate AS DATE), max(value_datetime)) AS Num_Days&#xd;\n				FROM obs&#xd;\n				WHERE concept_id = 3752&#xd;\n				group by person_id&#xd;\n				HAVING Num_Days &gt;= 7) as finalised&#xd;\n			)</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-07 14:01:00',4,'2019-05-09 09:19:04',4,0,NULL,NULL,NULL,'537bfeb1-7f85-4387-81c1-79f35d6b8193'),(410,'Clients multi month 4d','4d','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"306b1f50-9652-42e5-9f9f-bacb1a1f3ed1\" retired=\"false\">\n  <name>Clients multi month 4d</name>\n  <description>4d</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-07 14:02:06 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-09 09:20:44 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</