n id=\"1\" uuid=\"156bbd43-238b-4040-9b02-9f9ff5cd873b\" retired=\"false\">\n  <name>Clients newly initiated 5a</name>\n  <description>5a AZT-3TC-LPV</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-07 15:02:48 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-05-08 13:37:28 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>422</id>\n  <query>select distinct o.person_id&#xd;\nfrom obs o &#xd;\n	inner join location l on o.location_id = l.location_id&#xd;\n	INNER JOIN person ON person.person_id = o.person_id&#xd;\n	&#xd;\nwhere (o.location_id =:location or parent_location =:location)&#xd;\n	AND o.concept_id = 2249 &#xd;\n	AND o.value_datetime BETWEEN :startDate AND :endDate&#xd;\n	AND o.voided = 0&#xd;\n	&#xd;\nand o.person_id in(&#xd;\n		select distinct person_id&#xd;\n		from obs&#xd;\n        -- All patients given 1F regimen during a particular period&#xd;\n		where concept_id = 2250 and value_coded = 3681&#xd;\n		AND obs_datetime between :startDate AND :endDate&#xd;\n)&#xd;\n					&#xd;\nAND o.person_id not in (&#xd;\n   select distinct os.person_id &#xd;\n   from obs os&#xd;\n   where os.concept_id = 3634 AND os.value_coded = 2095 &#xd;\n   AND os.obs_datetime BETWEEN :startDate AND :endDate&#xd;\n   )&#xd;\nAND o.person_id not in &#xd;\n	(&#xd;\n	select distinct person_id &#xd;\n						from person&#xd;\n						where death_date &lt; :endDate&#xd;\n						and dead = 1&#xd;\n	)&#xd;\nAND o.person_id not in &#xd;\n	(&#xd;\n		select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt;= :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n					and obs_datetime &lt;= :endDate&#xd;\n                    group by person_id) one,&#xd;\n					&#xd;\n					 (&#xd;\n					select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843&#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n					) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)	&#xd;\n	)&#xd;\nAND person.voided = 0						 &#xd;\n;&#xd;\n</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-07 15:02:48',4,'2019-05-08 13:37:28',4,0,NULL,NULL,NULL,'156bbd43-238b-4040-9b02-9f9ff5cd873b'),(423,'Clients newly initiated 5b','ABC-3TC-LPV','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"d7833d79-8b04-4eac-88b8-0331a382d3b2\" retired=\"false\">\n  <name>Clients newly initiated 5b</name>\n  <description>ABC-3TC-LPV</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-07 15:04:01 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChang