e>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>440</id>\n  <query>SELECT DISTINCT Id&#xd;\nFROM&#xd;\n(&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n&#xd;\n                from obs o&#xd;\n				-- CAME IN PREVIOUS 5 MONTHS AND WAS GIVEN (6 MONHTS SUPPLY OF DRUGS)&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id				 &#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -5 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND o.concept_id = 4174 and o.value_coded = 4247&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					 INNER JOIN person_name ON person.person_id = person_name.person_id&#xd;\n					 INNER JOIN patient_identifier ON patient_identifier.patient_id = person.person_id AND patient_identifier.identifier_type = 3&#xd;\n					WHERE (o.location_id =:location or parent_location =:location) &#xd;\n				)&#xd;\nUNION&#xd;\n&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n                from obs o&#xd;\n                 INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n				 INNER JOIN location l on o.location_id = l.location_id&#xd;\n					 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n					 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n					 AND patient.voided = 0 AND o.voided = 0 &#xd;\n					 AND o.concept_id = 4174 and o.value_coded = 4247&#xd;\n					 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN patient ON os.person_id = patient.patient_id&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where &#xd;\n							MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -6 MONTH)) &#xd;\n							AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -6 MONTH))&#xd;\n							AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						    AND (os.location_id =:location or parent_location =:location))&#xd;\n					 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 &#xd;\n					 INNER JOIN person_name ON person.person_id = person_name.person_id&#xd;\n					 INNER JOIN patient_identifier ON patient_identifier.patient_id = person.person_id AND patient_identifier.identifier_type = 3&#xd;\n		WHERE (o.location_id =:location or parent_location =:location)&#xd;\n					 )&#xd;\n) AS ARTCurrent_PrevMonths&#xd;\n &#xd;\nWHERE ARTCurrent_PrevMonths.Id not in (&#xd;\n				select distinct patient.patient_id&#xd;\nfrom obs o&#xd;\n-- CLIENTS SEEN FOR ART&#xd;\n	INNER JOIN location l on o.location_id = l.location_id&#xd;\n	INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n	AND (o.concept_id = 3843 AND o.value_coded = 3841 OR o.value_coded = 3842)&#xd;\n	AND (DATE(o.obs_datetime) BETWEEN :startDate AND addDate(:endDate, 1))&#xd;\n	AND patient.voided = 0 AND o.voided = 0&#xd;\n	INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n	INNER JOIN person_name ON person.person_id = person_name.person_id&#xd;\n	INNER JOIN patient_identifier ON patient_identifier.patient_id = person.person_id &#xd;\n        AND patient_identifier.identifier_type = 3&#xd;\nand patient.patient_id not in (&#xd;\n	                       select distinct patient.patient_id AS Id&#xd;\n	                       from obs o&#xd;\n	                       -- CLIENTS NEWLY INITIATED ON ART&#xd;\n							INNER JOIN patient ON o.person_id = patient.patient_id													&#xd;\n							AND (o.concept_id = 2249 AND DATE(o.value_datetime) BETWEEN :startDate AND addDate(:endDate, 1))&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n							AND o.person_id not in (																		 &#xd;\n                        select distinct os.person_id from obs os															 &#xd;\n                        where os.concept_id = 3634 															 &#xd;\n                        AND os.value_coded = 2095 														 &#xd;\n                        AND DATE(os.obs_datetime) BETWEEN :startDate AND addDate(:endDate, 1)&#xd;\n																			 &#xd;\n                        )&#xd;\n				)&#xd;\n	WHERE (o.location_id =:location or parent_location =:location)&#xd;\n)</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-02-27 10:49:11',4,'2019-02-27 10:50:14',4,0,NULL,NULL,NULL,'5f4b2a04-8b0c-4add-b7c9-7b70515f603d'),(441,'clients seen 2 to 6mnths ago','composition','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.CompositionCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.CompositionCohortDefinition id=\"1\" uuid=\"8f521b14-95ad-4e4c-b03d-10c0b7b3a0aa\" retired=\"false\">\n  <name>clients seen 2 to 6mnths ago</name>\n  <description>composition</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-02-27 10:59:28 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-02-27 14:18:26 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>441</id>\n  <compositionString>clients-seen-3months-ago OR clients-seen-2months-ago</compositionString>\n  <searches id=\"9\">\n    <entry>\n      <string>clients-seen-3months-ago</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"11\" uuid=\"21c776ca-7cbc-4388-a623-06e351469a20\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </searches>\n</org.openmrs.module.reporting.cohort.definition.CompositionCohortDefinition>','2019-02-27 10:59:28',4,'2019-02-27 14:18:26',4,0,NULL,NULL,NULL,'8f521b14-95ad-4e4c-b03d-10c0b7b3a0aa'),(442,'Clients on ARV who died','Clients on ARV who died','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"914d4f42-66e2-4fce-b1da-d3fce7f95f15\" retired=\"false\">\n  <name>Clients on ARV who died</name>\n  <description>Clients on ARV who died</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-03-29 06:48:55 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-05 12:54:42 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>442</id>\n  <query>select person_id &#xd;\nfrom person &#xd;\nwhere death_date between :startDate AND :endDate&#xd;\nand dead = 1&#xd;\nand person_id in&#xd;\n   (&#xd;\n    select person_id &#xd;\n    from obs &#xd;\n    where concept_id = 2249&#xd;\n    )</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-03-29 08:48:55',4,'2020-06-05 14:54:42',4,0,NULL,NULL,NULL,'914d4f42-66e2-4fce-b1da-d3fce7f95f15'),(443,'Clients given 2weeks ARV','Clients given 2weeks ARV','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"d8bb0175-47c0-461b-b457-498c8ef3cf27\" retired=\"false\">\n  <name>Clients given 2weeks ARV</name>\n  <description>Clients given 2weeks ARV</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2019-03-29 07:53:59 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-03-29 07:57:45 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>443</id>\n  <query>select distinct Id from(&#xd;\nselect distinct Id from&#xd;\n(&#xd;\n	(select distinct o.person_id AS Id&#xd;\n	from obs o &#xd;\n	inner join location l on o.location_id = l.location_id&#xd;\n	where (o.location_id = :location or parent_location = :location)&#xd;\n	and o.concept_id = 2250 &#xd;\n	and o.value_coded in (2201,2203,2205,2207,3672,3673,2210,2209,3674,3675,3676,3677,3683,3684,3685,2202,2204,3679,3680,3681,3682,3686,2143)&#xd;\n	and o.person_id in (&#xd;\n				select distinct o.person_id&#xd;\n				from obs o &#xd;\n				where (o.concept_id = 4174 and o.value_coded = 4243)&#xd;\n				and obs_datetime BETWEEN :startDate and DATE_ADD(:endDate, INTERVAL 1 DAY)&#xd;\n				)&#xd;\n	&#xd;\n	and o.voided = 0&#xd;\n	and obs_datetime BETWEEN :startDate and DATE_ADD(:endDate, INTERVAL 1 DAY)&#xd;\n	)&#xd;\n	UNION&#xd;\n(select distinct patient.patient_id AS Id&#xd;\n     from obs o&#xd;\n     INNER JOIN patient ON o.person_id = patient.patient_id&#xd;\n	 INNER JOIN location l on o.location_id = l.location_id	&#xd;\n	 AND MONTH(o.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -28 DAY))&#xd;\n	 AND YEAR(o.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -28 DAY)) &#xd;\n	 AND patient.voided = 0 AND o.voided = 0 &#xd;\n	 AND (o.concept_id = 4174 and o.value_coded = 4243)&#xd;\n	 AND o.person_id in (&#xd;\n						select distinct os.person_id from obs os&#xd;\n						INNER JOIN patient ON os.person_id = patient.patient_id&#xd;\n						INNER JOIN location l on os.location_id = l.location_id						&#xd;\n						where MONTH(os.obs_datetime) = MONTH(DATE_ADD(:endDate, INTERVAL -28 DAY)) &#xd;\n						AND YEAR(os.obs_datetime) = YEAR(DATE_ADD(:endDate, INTERVAL -28 DAY))&#xd;\n						AND os.concept_id = 3752 AND DATEDIFF(os.value_datetime, :endDate) BETWEEN 0 AND 28&#xd;\n						AND (os.location_id = :location  or parent_location = :location )&#xd;\n					 )&#xd;\n	INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0				 			&#xd;\n	WHERE (o.location_id = :location  or parent_location = :location )&#xd;\n	and o.person_id in(&#xd;\n						select distinct person_id from obs os&#xd;\n						where os.concept_id = 2250 &#xd;\n						and os.value_coded in (2201,2203,2205,2207,3672,3673,2210,2209,3674,3675,3676,3677,3683,3684,3685,2202,2204,3679,3680,3681,3682,3686,2143)&#xd;\n					)&#xd;\n	)&#xd;\n) as regimen&#xd;\nwhere Id not in (																		 &#xd;\n				select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; DATE_ADD(:endDate, INTERVAL 1 DAY))													  														 							 &#xd;\n				)&#xd;\nAND Id not in (&#xd;\n			select person_id &#xd;\n			from person &#xd;\n			where death_date &lt; DATE_ADD(:endDate, INTERVAL 1 DAY) &#xd;\n			and dead = 1&#xd;\n			)&#xd;\n	)as final</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-03-29 07:5