s;Testing_History&apos; , sort_order&#xd;\nFROM&#xd;\n				(select distinct patient.patient_id AS Id,&#xd;\n									   patient_identifier.identifier AS patientIdentifier,&#xd;\n									   concat(person_name.given_name, &apos; &apos;, person_name.family_name) AS patientName,&#xd;\n									   floor(datediff(CAST(:endDate AS DATE), person.birthdate)/365) AS Age,&#xd;\n									   (select name from concept_name cn where cn.concept_id = o.value_coded and concept_name_type=&apos;FULLY_SPECIFIED&apos;) AS HIV_Status,&#xd;\n									   person.gender AS Gender,&#xd;\n									   observed_age_group.name AS age_group,&#xd;\n									   observed_age_group.sort_order AS sort_order&#xd;\n&#xd;\n				from obs o&#xd;\n						-- HTS CLIENTS WITH HIV STATUS BY SEX AND AGE&#xd;\n						 INNER JOIN patient ON o.person_id = patient.patient_id &#xd;\n						 AND o.concept_id = 2165&#xd;\n						 AND patient.voided = 0 AND o.voided = 0&#xd;\n						 AND o.obs_datetime BETWEEN CAST(:startDate AS DATE) AND CAST(:endDate AS DATE)&#xd;\n						 &#xd;\n						 -- PROVIDER INITIATED TESTING AND COUNSELING&#xd;\n						 AND o.person_id in (&#xd;\n							select distinct os.person_id &#xd;\n							from obs os&#xd;\n							where os.concept_id = 4228 and os.value_coded = 4227&#xd;\n							AND os.obs_datetime BETWEEN CAST(:startDate AS DATE) AND CAST(:endDate AS DATE)&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n						 )&#xd;\n						 &#xd;\n						 -- NEW TESTER, DOES NOT HAVE A HISTORY OF PREVIOUS TESTING&#xd;\n						 AND o.person_id in (&#xd;\n							select distinct os.person_id&#xd;\n							from obs os&#xd;\n							where os.concept_id = 2137 and os.value_coded = 2147&#xd;\n							AND os.obs_datetime BETWEEN CAST(:startDate AS DATE) AND CAST(:endDate AS DATE)&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n						 )&#xd;\n						 &#xd;\n						 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n						 INNER JOIN person_name ON person.person_id = person_name.person_id&#xd;\n						 INNER JOIN patient_identifier ON patient_identifier.patient_id = person.person_id AND patient_identifier.identifier_type = 3&#xd;\n						 INNER JOIN reporting_age_group AS observed_age_group ON&#xd;\n						  CAST(:endDate AS DATE) BETWEEN (DATE_ADD(DATE_ADD(person.birthdate, INTERVAL observed_age_group.min_years YEAR), INTERVAL observed_age_group.min_days DAY))&#xd;\n						  AND (DATE_ADD(DATE_ADD(person.birthdate, INTERVAL observed_age_group.max_years YEAR), INTERVAL observed_age_group.max_days DAY))&#xd;\n				   WHERE observed_age_group.report_group_name = &apos;Modified_Ages&apos;) AS HTSClients_HIV_Status&#xd;\nORDER BY HTSClients_HIV_Status.HIV_Status, HTSClients_HIV_Status.Age)&#xd;\n) as hiv&#xd;\nWHERE HIV_Status = &apos;Negative&apos;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-04-24 12:18:19',4,'2020-04-24 12:21:06',4,0,NULL,NULL,NULL,'e9556cb4-8e7f-4de4-9384-0b1ebacad149'),(461,'PITC_New_Positive','new tested positive clients','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"1a4da7db-09d2-4d28-b38d-bed4cf703253\" retired=\"false\">\n  <name>PITC_New_Positive</name>\n  <description>new tested positive clients</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2020-04-24 12:22:19 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-04-24 12:22:59 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openm