p.min_years YEAR), INTERVAL observed_age_group.min_days DAY))&#xd;\n						  AND (DATE_ADD(DATE_ADD(person.birthdate, INTERVAL observed_age_group.max_years YEAR), INTERVAL observed_age_group.max_days DAY))&#xd;\n				   WHERE observed_age_group.report_group_name = &apos;Modified_Ages&apos;) AS HTSClients_HIV_Status&#xd;\nORDER BY HTSClients_HIV_Status.HIV_Status, HTSClients_HIV_Status.Age)&#xd;\n) as hts&#xd;\nwhere HIV_Status = &apos;Negative&apos;&#xd;\n&#xd;\n</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-04-24 12:28:12',4,'2020-04-24 12:29:12',4,0,NULL,NULL,NULL,'0750dd97-8565-4679-a1c2-052dc049f345'),(463,'PITC_Repeat_Positive','repeat positive clients','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"9bba9c3a-f886-477f-997f-a7325a668ee7\" retired=\"false\">\n  <name>PITC_Repeat_Positive</name>\n  <description>repeat positive clients</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2020-04-24 12:31:42 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-04-24 12:32:50 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter 