S TESTING&#xd;\n						 AND o.person_id in (&#xd;\n							select distinct os.person_id&#xd;\n							from obs os&#xd;\n							where os.concept_id = 2137 and os.value_coded = 2146&#xd;\n							AND os.obs_datetime BETWEEN CAST(:startDate AS DATE) AND CAST(:endDate AS DATE)&#xd;\n							AND patient.voided = 0 AND o.voided = 0&#xd;\n						 )&#xd;\n						 &#xd;\n						 INNER JOIN person ON person.person_id = patient.patient_id AND person.voided = 0&#xd;\n						 INNER JOIN person_name ON person.person_id = person_name.person_id&#xd;\n						 INNER JOIN patient_identifier ON patient_identifier.patient_id = person.person_id AND patient_identifier.identifier_type = 3&#xd;\n						 INNER JOIN reporting_age_group AS observed_age_group ON&#xd;\n						  CAST(:endDate AS DATE) BETWEEN (DATE_ADD(DATE_ADD(person.birthdate, INTERVAL observed_age_group.min_years YEAR), INTERVAL observed_age_group.min_days DAY))&#xd;\n						  AND (DATE_ADD(DATE_ADD(person.birthdate, INTERVAL observed_age_group.max_years YEAR), INTERVAL observed_age_group.max_days DAY))&#xd;\n				   WHERE observed_age_group.report_group_name = &apos;Modified_Ages&apos;) AS HTSClients_HIV_Status&#xd;\nORDER BY HTSClients_HIV_Status.HIV_Status, HTSClients_HIV_Status.Age)&#xd;\n) as hts&#xd;\nwhere HIV_Status = &apos;Positive&apos;&#xd;\n&#xd;\n</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-04-24 12:31:42',4,'2020-04-24 12:32:50',4,0,NULL,NULL,NULL,'9bba9c3a-f886-477f-997f-a7325a668ee7'),(464,'PITC New Negative','PITC New Negative','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"e4a53f3d-9351-4ba9-a039-c1f772b53b05\" retired=\"false\">\n  <name>PITC New Negative</name>\n  <description>PITC New Negative</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCre