-4cb5-a27d-fe60c9dcfdf2\"/>\n    <parameterMappings id=\"11\">\n      <entry>\n        <string>endDate</string>\n        <string>${endDate}</string>\n      </entry>\n      <entry>\n        <string>location</string>\n        <string>${location}</string>\n      </entry>\n      <entry>\n        <string>startDate</string>\n        <string>${startDate}</string>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2020-06-05 14:15:41',4,'2020-06-05 14:16:26',4,0,NULL,NULL,NULL,'6e5cbb5d-f451-47ea-a2fd-9bff1f28f555'),(672,'Missed or defaulted under 28days','missed or defaulted < 28','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"a7064d93-cb9d-44f7-b7cb-f0d38313fdb3\" retired=\"false\">\n  <name>Missed or defaulted under 28days</name>\n  <description>missed or defaulted &lt; 28</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2020-06-05 12:16:25 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-05 12:20:06 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>672</id>\n  <query>select distinct o.person_id &#xd;\nFROM obs o&#xd;\nINNER JOIN patient ON o.person_id = patient.patient_id &#xd;\nand o.concept_id = 3752 &#xd;\nand o.value_datetime in&#xd;\n	(				&#xd;\n		select latestFU from&#xd;\n		(&#xd;\n		select distinct os.person_id, max(os.value_datetime) AS latestFU, datediff(CAST(:endDate AS DATE), max(value_datetime)) AS &#xd;\n                Num_Days&#xd;\n                from obs os&#xd;\n                inner join person_name pn on os.person_id = pn.person_id&#xd;\n                inner join patient p  on pn.person_id = p.patient_id and pn.voided = 0&#xd;\n                inner join person ps on ps.person_id = p.patient_id and ps.voided = 0&#xd;\n		where os.concept_id = 3752 &#xd;\n                and obs_datetime &lt;= :endDate&#xd;\n		group by os.person_id&#xd;\n		having Num_Days &gt; 7&#xd;\n                and Num_Days &lt; 30&#xd;\n		) as lost&#xd;\n	)									&#xd;\nand o.person_id in&#xd;\n	(				&#xd;\n		select person_id from&#xd;\n		(&#xd;\n		    select distinct os.person_id, max(os.value_datetime) AS latestFU, datediff(CAST(:endDate AS DATE), &#xd;\n                    max(value_datetime)) AS Num_Days&#xd;\n		    from obs os&#xd;\n		    inner join person_name pn on os.person_id = pn.person_id&#xd;\n		    inner join patient p  on pn.person_id = p.patient_id and pn.voided = 0&#xd;\n		    inner join person ps on ps.person_id = p.patient_id and ps.voided = 0&#xd;\n		    where os.concept_id = 3752 &#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n		    group by os.person_id&#xd;\n		    having Num_Days &gt; 7&#xd;\n                    and Num_Days &lt;= 28&#xd;\n		) as lost&#xd;\n	)&#xd;\n		&#xd;\nAND o.person_id not in (																		 &#xd;\n			select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n                                        group by person_id) one,&#xd;\n					&#xd;\n					 (&#xd;\n					select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843 ) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)													  														 							 &#xd;\n			)&#xd;\nAND o.person_id not in (&#xd;\n			select person_id &#xd;\n			from person &#xd;\n			where death_date &lt;= :endDate &#xd;\n			and dead = 1&#xd;\n			)&#xd;\n&#xd;\n;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-06-05 14:16:25',4,'2020-06-05 14:20:06',4,0,NULL,NULL,NULL,'a7064d93-cb9d-44f7-b7cb-f0d38313fdb3'),(673,'adult_arv_1m_other_mnths','1m other supply','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"9ebb3d1c-52e8-40e7-abc2-871abfdd6ffa\" retired=\"false\">\n  <name>adult_arv_1m_other_mnths</name>\n  <description>1m other supply</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2020-06-05 12:16:47 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-05 12:17:21 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.par