n_id = patient.patient_id &#xd;\nand o.concept_id = 3752 &#xd;\nand o.value_datetime in&#xd;\n	(				&#xd;\n		select latestFU from&#xd;\n		(&#xd;\n		select distinct os.person_id, max(os.value_datetime) AS latestFU, datediff(CAST(:endDate AS DATE), max(value_datetime)) AS &#xd;\n                Num_Days&#xd;\n                from obs os&#xd;\n                inner join person_name pn on os.person_id = pn.person_id&#xd;\n                inner join patient p  on pn.person_id = p.patient_id and pn.voided = 0&#xd;\n                inner join person ps on ps.person_id = p.patient_id and ps.voided = 0&#xd;\n		where os.concept_id = 3752 &#xd;\n                and obs_datetime &lt;= :endDate&#xd;\n		group by os.person_id&#xd;\n		having Num_Days &gt; 7&#xd;\n                and Num_Days &lt; 30&#xd;\n		) as lost&#xd;\n	)									&#xd;\nand o.person_id in&#xd;\n	(				&#xd;\n		select person_id from&#xd;\n		(&#xd;\n		    select distinct os.person_id, max(os.value_datetime) AS latestFU, datediff(CAST(:endDate AS DATE), &#xd;\n                    max(value_datetime)) AS Num_Days&#xd;\n		    from obs os&#xd;\n		    inner join person_name pn on os.person_id = pn.person_id&#xd;\n		    inner join patient p  on pn.person_id = p.patient_id and pn.voided = 0&#xd;\n		    inner join person ps on ps.person_id = p.patient_id and ps.voided = 0&#xd;\n		    where os.concept_id = 3752 &#xd;\n                    and obs_datetime &lt;= :endDate&#xd;\n		    group by os.person_id&#xd;\n		    having Num_Days &gt; 28&#xd;\n                    and Num_Days &lt; 90&#xd;\n		) as lost&#xd;\n	)&#xd;\n		&#xd;\nAND o.person_id not in (																		 &#xd;\n			select distinct os.person_id &#xd;\n				from obs os&#xd;\n				where (os.concept_id = 4155 and os.value_coded = 2146 and obs_datetime &lt; :endDate and person_id not in &#xd;\n				(select person_id from&#xd;\n					(select person_id who, max(value_datetime) latest&#xd;\n					from obs &#xd;\n					where concept_ID = 2266&#xd;\n                                        group by person_id) one,&#xd;\n					&#xd;\n					 (&#xd;\n					select person_id,obs_datetime &#xd;\n					from obs &#xd;\n					where concept_id = 3843 ) two&#xd;\n					&#xd;\n					where who = person_id&#xd;\n					and DATE(obs_datetime) &gt; DATE(latest))&#xd;\n					)													  														 							 &#xd;\n			)&#xd;\nAND o.person_id not in (&#xd;\n			select person_id &#xd;\n			from person &#xd;\n			where death_date &lt;= :endDate &#xd;\n			and dead = 1&#xd;\n			)&#xd;\n&#xd;\n;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-06-05 14:22:30',4,'2020-06-05 14:23:01',4,0,NULL,NULL,NULL,'5be87aeb-a57c-4a02-83e7-93d560d49fbb'),(678,'adult_arv_other_other_mnths','other other supply','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"c53c49b3-0557-4f1a-9006-1a88e542519d\" retired=\"false\">\n  <name>adult_arv_other_other_mnths</name>\n  <description>other other supply</description>\n  <creator id=\"2\" uuid=\"c1c21e11-3f10-11e4-adec-0800271c1b75\"/>\n  <dateCreated id=\"3\">2020-06-05 12:23:07 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-05 12:23:55 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=